import './navbar.css';

import React, {useState} from 'react';
import { NavLink } from 'react-router-dom';
import { useSelector } from 'react-redux';

import LogoutButton from '../auth/LogoutButton';
import SearchBar from '../Searchbar/SearchBar';


const NavBar = () => {
  const sessionUser = useSelector(state => state.session);


  const [menuOpen, setMenuOpen] = useState(false);
  const [isLogged, setIsLogged] = useState(false);


  const handleMenuOpen = () => {
    setMenuOpen(!menuOpen);
  }

  const isUserLoggedIn = () => {
    if (sessionUser.user === null) {
      setIsLogged(false);
      setMenuOpen(!menuOpen);
    } else {
      setIsLogged(true);
      setMenuOpen(!menuOpen);
    }
  }

  // mini modal for user profile button
  const [showProfileModal, setShowProfileModal] = useState(false);

  const openProfileModal = () => {
    setShowProfileModal(prev => !prev);
  };

  const closeProfileModal = () => {
    setShowProfileModal(false);
  };






  return (
    <>
    <div className="navBar">

      <div className="logo">
        <div>
          <NavLink to='/feed'>
            Connectd
          </NavLink>
        </div>
      </div>
      <div className="navSearch">
        <i className="fas fa-search"></i>
          <SearchBar />
      </div>
      <div className="rightNav">
        <NavLink to='/feed'>
          <i className="fas fa-home" id="home"></i>
        </NavLink>
        <NavLink to='/new/events'>
          <i className="fas fa-upload" id="upload"></i>
        </NavLink>
        <NavLink to='/about' className="about-nav">
          About
        </NavLink>
        {/* <NavLink to='/profile' >
          <i className="far fa-user-circle" id="profile" ></i>
        </NavLink> */}
        <div className="profile-nav">
          <i className="far fa-user-circle" id="profile" onClick={openProfileModal}></i>
        </div>
        <div className="menu">
          <i className="fas fa-bars" onClick={handleMenuOpen}></i>
        </div>
      </div>
    </div>

    <div className={menuOpen ? "menu-open" : "menu-closed"}>
      <div className="menu-inner">
        <div className="menu-top">
          <div className="menu-top-left">
            <i className="fas fa-bars" onClick={handleMenuOpen}></i>
          </div>
          <div className="menu-top-right">
            <i className="fas fa-times" onClick={handleMenuOpen}></i>
          </div>
        </div>
        <div className="menu-middle">
          <div className="menu-middle-inner">
            <NavLink to='/feed' onClick={handleMenuOpen}>
              <i className="fas fa-home" id="home"></i>
              <span>Home</span>
            </NavLink>
            <NavLink to='/new/events' onClick={handleMenuOpen}>
              <i className="fas fa-upload" id="upload"></i>
              <span>Upload</span>
            </NavLink>
            <NavLink to='/about' className="about-nav" onClick={handleMenuOpen}>
              <span>About</span>
            </NavLink>
            <NavLink to='/profile' onClick={handleMenuOpen}>
              <i className="far fa-user-circle" id="profile" ></i>
              <span>Profile</span>
            </NavLink>
          </div>
        </div>





            {/* <NavLink to='/logout'>
              <LogoutButton />
            </NavLink> */}
      </div>
    </div>
    </>
  );
}



export default NavBar;
